import { Line } from "../../plugins/baseChart.js";
export default {
  extends: Line,
  data: function data() {
    return {
      data_chart: [40, 59, 45, 50, 39],
      label: "Pendapatan Mingguan"
    };
  },
  mounted: function mounted() {
    this.renderChart({
      labels: ["1", "2", "3", "4", "5"],
      datasets: [{
        label: this.label,
        backgroundColor: "#42a5f5",
        data: this.data_chart
      }]
    }, {
      responsive: true,
      maintainAspectRatio: false
    });
  }
};
